function pairElement(str) {

const matching = function(pairing) {
  switch (pairing) {
    case "A":
    return ["A", "T"];
    case "T":
    return ["T", "A"];
    case "C":
    return ["C", "G"];
    case "G":
    return ["G", "C"];
  }
}

const pair = []
for (let i = 0; i < str.length; i++) {
  pair.push(matching(str[i]))
}
return pair
}

